import React from 'react';
import Logo from './images/logo.png';
import './SideNav.css';

const SideNav = () => {
  return (
    <>
      <div className='Navbar'>
        <img className='logo' src={Logo} alt='Avatar' />
      </div>
    </>
  );
};

export default SideNav;
